// HomeTile.js
import { useNavigate } from "react-router-dom";
import "../Styles/HomeTile.css";

function HomeTile({ text, img }) {
  const navigate = useNavigate();

  const handleClick = () => {
    // Convert the category text to lowercase to match your schema values if needed
    const category = text.toLowerCase();
    // Navigate to the ListingsPage with the category query parameter
    navigate(`/listings?category=${encodeURIComponent(category)}`);
  };

  return (
    <div className="HomeTile-container" onClick={handleClick}>
      <img src={img} alt={text} className="HomeTile-img" />
      <p>{text}</p>
    </div>
  );
}

export default HomeTile;
